import React from 'react';
import { Redirect, Route, Switch } from 'react-router-dom/cjs/react-router-dom.min';
import { routes } from '../router';
const AppRouter = () => {
    return (
        <Switch>
            {
                routes.map(route => 
                    <Route component={route.component}
                        path={route.path}
                        exact={route.exact}
                    />
                )
            }
            <Redirect to='/posts' />
        </Switch>
    )
}

export default AppRouter
